import React, { useState, useEffect } from "react";
import axios from "axios";
import OrganizationForm from "./OrganizationForm"; // Assuming this is the improved version
import MemberList from "./MemberList"; // Assuming this is the improved version
import Sidebar from '../components/Sidebar';
import Navbar from '../components/Navbar';
import { FaBuilding, FaUsers, FaChevronDown } from 'react-icons/fa'; // Import icons

const Teams = () => {
  const [organizations, setOrganizations] = useState([]);
  const [selectedOrgId, setSelectedOrgId] = useState(null);
  const [loadingOrgs, setLoadingOrgs] = useState(true);
  const [orgsError, setOrgsError] = useState(null);

  // Function to fetch organizations, passed down to OrganizationForm for refresh
  const fetchOrgs = async () => {
    setLoadingOrgs(true);
    setOrgsError(null);
    try {
      const res = await axios.get("http://localhost:8001/organizations/");
      setOrganizations(res.data);
      // If no organization is selected and there are orgs, select the first one by default
      if (!selectedOrgId && res.data.length > 0) {
        setSelectedOrgId(res.data[0].id);
      }
    } catch (err) {
      console.error("Failed to fetch organizations:", err);
      setOrgsError("Could not load organizations. Please try refreshing.");
    } finally {
      setLoadingOrgs(false);
    }
  };

  useEffect(() => {
    fetchOrgs();
  }, []);

  return (
    <div className="min-h-screen bg-gray-50 font-sans">
      <Sidebar />
      <div className="pl-64 flex flex-col"> {/* Adjust padding for sidebar */}
        <Navbar />
        
        <main className="flex-1 p-8">
          <div className="max-w-7xl mx-auto">
            <h1 className="text-4xl font-extrabold text-blue-700 mb-10 text-center flex items-center justify-center">
              <FaBuilding className="mr-4 text-blue-500" /> Manage Your Organizations & Teams
            </h1>

            {/* Organization Creation Section */}
            <section className="mb-12 bg-white shadow-xl rounded-xl border border-blue-200">
              <OrganizationForm onOrganizationCreated={fetchOrgs} /> {/* Pass fetchOrgs to refresh list */}
            </section>

            {/* Organization Selection & Member Management Section */}
            <section className="bg-white shadow-xl rounded-xl p-8 border border-indigo-200">
              <h2 className="text-3xl font-bold text-gray-800 mb-6 flex items-center">
                <FaUsers className="mr-3 text-indigo-600" /> Team Members Overview
              </h2>

              {loadingOrgs ? (
                <div className="text-center text-gray-500 text-lg py-10">
                  <FaSpinner className="animate-spin inline-block mr-2" /> Loading organizations...
                </div>
              ) : orgsError ? (
                <div className="text-center text-red-600 bg-red-50 p-4 rounded-lg text-lg mb-6">
                  <FaExclamationCircle className="inline-block mr-2" /> {orgsError}
                </div>
              ) : organizations.length === 0 ? (
                <div className="text-center text-gray-500 bg-gray-50 p-6 rounded-lg text-lg mb-6 shadow-sm">
                  <p className="font-semibold text-gray-700 mb-3">No organizations available to manage.</p>
                  <p>Please create an organization above to get started with team management.</p>
                </div>
              ) : (
                <>
                  <label htmlFor="org-select" className="block text-lg font-medium text-gray-700 mb-2">
                    Select an Organization to View/Manage Members:
                  </label>
                  <div className="relative inline-block w-full max-w-sm mb-8">
                    <select
                      id="org-select"
                      onChange={(e) => setSelectedOrgId(e.target.value)}
                      value={selectedOrgId || ''} // Ensure controlled component
                      className="block w-full p-3 pr-10 border border-gray-300 rounded-lg shadow-sm bg-white text-gray-800 appearance-none focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:border-transparent transition duration-200"
                    >
                      <option value="" disabled>-- Select Organization --</option>
                      {organizations.map((org) => (
                        <option key={org.id} value={org.id}>
                          {org.name}
                        </option>
                      ))}
                    </select>
                    <div className="pointer-events-none absolute inset-y-0 right-0 flex items-center px-2 text-gray-700">
                      <FaChevronDown className="h-4 w-4" />
                    </div>
                  </div>

                  {selectedOrgId ? (
                    <div className="mt-8">
                      {/* Dynamically get the selected organization's name */}
                      <h3 className="text-2xl font-bold text-indigo-700 mb-6">
                        Members of{" "}
                        <span className="bg-indigo-100 px-3 py-1 rounded-md">
                          {organizations.find(org => org.id === selectedOrgId)?.name || "Selected Organization"}
                        </span>
                      </h3>
                      <MemberList orgId={selectedOrgId} />
                    </div>
                  ) : (
                    <div className="text-center text-gray-500 bg-gray-50 p-6 rounded-lg text-lg mt-8 shadow-sm">
                      Please select an organization from the dropdown above to view and manage its members.
                    </div>
                  )}
                </>
              )}
            </section>
          </div>
        </main>
      </div>
    </div>
  );
};

export default Teams;
